import React  from "react";

const InputField = ({ value, label, name, placeholder, onChange }) => (
        <label>{label}: 
            <input
            value={value}
            name={name}
            placeholder={placeholder}
            onChange={onChange}
        />
        </label>
);

export default InputField;
